import React from 'react'
import './App.css';

const RestaurantList = ({eventClick, label, customStyle}) => {
  return (
    <div 
      className="block-button"
      style={customStyle}
      onClick={eventClick}>
      <label>{label}</label>
    </div>
  );
}

export default RestaurantList;
